    const fetchMypage = () => {
        axios.get('http://localhost:8000/mypage')  
            .then((res) => { 
                console.log(res.data.id)
            })
            .catch((err) => {
                console.log(err)
        })
    }
    return (
        <div> 
            <h1> 이것은 마이페이지 </h1>
        </div>
    )
}

export default Mypage
